import React, { useState } from 'react';
import {
  Container,
  Typography,
  TextField,
  Button,
  Box,
  Checkbox,
  FormControlLabel,
  FormHelperText,
} from '@mui/material';

function SignUp() {
  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    password: '',
    agreeToTerms: false,
    agreeToPrivacy: false,
    country: '',
    state: '',
    zipCode: '',
  });

  const [errors, setErrors] = useState({});

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const validateForm = () => {
    const newErrors = {};
    if (!formData.fullName.trim()) newErrors.fullName = 'Full Name is required';
    if (!formData.email.trim()) newErrors.email = 'Email is required';
    if (!formData.password.trim()) newErrors.password = 'Password is required';
    if (!formData.country.trim()) newErrors.country = 'Country is required';
    if (!formData.state.trim()) newErrors.state = 'State is required';
    if (!formData.zipCode.trim()) newErrors.zipCode = 'Zip Code is required';
    if (!formData.agreeToTerms) newErrors.agreeToTerms = 'You must agree to the Terms of Service';
    if (!formData.agreeToPrivacy) newErrors.agreeToPrivacy = 'You must agree to the Privacy Policy';
    return newErrors;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const formErrors = validateForm();
    if (Object.keys(formErrors).length > 0) {
      setErrors(formErrors);
    } else {
      // Handle form submission, such as sending data to the server
      console.log(formData);
    }
  };

  return (
    <Container maxWidth="sm" sx={{ paddingY: 8 }}>
      <Typography variant="h4" align="center" sx={{ marginBottom: 4, color: '#2a5e4f' }}>
        Create Your Account
      </Typography>
      <form onSubmit={handleSubmit}>
        <Box sx={{ marginBottom: 4 }}>
          <Typography variant="h6" sx={{ color: '#2a5e4f', marginBottom: 2 }}>
            Basic Information
          </Typography>
          <TextField
            fullWidth
            label="Full Name"
            name="fullName"
            value={formData.fullName}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            error={!!errors.fullName}
            helperText={errors.fullName}
            required
          />
          <TextField
            fullWidth
            label="Email"
            name="email"
            type="email"
            value={formData.email}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            error={!!errors.email}
            helperText={errors.email}
            required
          />
          <TextField
            fullWidth
            label="Password"
            name="password"
            type="password"
            value={formData.password}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            error={!!errors.password}
            helperText={errors.password}
            required
          />
        </Box>

        <Box sx={{ marginBottom: 4 }}>
          <Typography variant="h6" sx={{ color: '#2a5e4f', marginBottom: 2 }}>
            Agreements
          </Typography>
          <FormControlLabel
            control={
              <Checkbox
                name="agreeToTerms"
                checked={formData.agreeToTerms}
                onChange={handleChange}
                required
              />
            }
            label="I agree to the Terms of Service"
          />
          {errors.agreeToTerms && (
            <FormHelperText error>{errors.agreeToTerms}</FormHelperText>
          )}
          <FormControlLabel
            control={
              <Checkbox
                name="agreeToPrivacy"
                checked={formData.agreeToPrivacy}
                onChange={handleChange}
                required
              />
            }
            label="I agree to the Privacy Policy"
          />
          {errors.agreeToPrivacy && (
            <FormHelperText error>{errors.agreeToPrivacy}</FormHelperText>
          )}
        </Box>

        <Box sx={{ marginBottom: 4 }}>
          <Typography variant="h6" sx={{ color: '#2a5e4f', marginBottom: 2 }}>
            Location Information
          </Typography>
          <TextField
            fullWidth
            label="Country"
            name="country"
            value={formData.country}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            error={!!errors.country}
            helperText={errors.country}
            required
          />
          <TextField
            fullWidth
            label="State"
            name="state"
            value={formData.state}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            error={!!errors.state}
            helperText={errors.state}
            required
          />
          <TextField
            fullWidth
            label="Zip Code"
            name="zipCode"
            value={formData.zipCode}
            onChange={handleChange}
            variant="outlined"
            error={!!errors.zipCode}
            helperText={errors.zipCode}
            required
          />
        </Box>

        <Button
          variant="contained"
          type="submit"
          fullWidth
          sx={{
            backgroundColor: '#2a5e4f',
            color: '#ffffff',
            paddingY: 1.5,
            borderRadius: '25px',
            boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.2)',
            '&:hover': { backgroundColor: '#204c3d' },
          }}
        >
          Create Account
        </Button>
      </form>
    </Container>
  );
}

export default SignUp;
